import React, { useState } from "react";
import "./RegisterModal.css";
import logo from "../assets/logo/logo.png"; // <-- replace with your logo path

const RegisterModal = ({ onClose }) => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    contact: "",
    state: "",
    city: ""
  });

  const handleChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = e => {
    e.preventDefault();
    console.log("Registration form submitted:", formData);
    alert("Thank you for registering!");
    onClose();
  };

  return (
    <div className="register-modal-backdrop">
      <div className="register-modal">
        <button className="close-btn" onClick={onClose}>
          &times;
        </button>
        <div className="register-header">
          <img src={logo} alt="Franmax Expo Logo" />
          <h2>Register for Franmax Expo 2025</h2>
        </div>

        <div className="register-benefits">
          <h3>Why Attend?</h3>
          <ul>
            <li>Discover top franchise opportunities</li>
            <li>Meet investors and industry experts</li>
            <li>Learn from keynote speakers and workshops</li>
            <li>Network with decision makers</li>
          </ul>
        </div>

        <form onSubmit={handleSubmit} className="register-form">
          <input
            type="text"
            name="name"
            placeholder="Full Name"
            value={formData.name}
            onChange={handleChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Email Address"
            value={formData.email}
            onChange={handleChange}
            required
          />
          <input
            type="tel"
            name="contact"
            placeholder="Contact Number"
            value={formData.contact}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="state"
            placeholder="State"
            value={formData.state}
            onChange={handleChange}
            required
          />
          <input
            type="text"
            name="city"
            placeholder="City"
            value={formData.city}
            onChange={handleChange}
            required
          />

          <button type="submit" className="register-submit-btn">
            Submit Registration
          </button>
        </form>
      </div>
    </div>
  );
};

export default RegisterModal;
